import React from 'react';
import { Link } from 'react-router-dom';
import api from '../../services/api';

import './List.css';

async function handleDelete({ onDelete }, id){

    await onDelete({
        id
    })
}

const List = ({user}) => (
    <div className="usersList">
        <h3> Usu√°rio </h3>
        <p>{ user.name }</p>

        <div className="buttons">
            <Link to={`/details/${user._id}`}><button className="btn btn-info">Visualizar</button></Link>
            <Link to={`/update/${user._id}`}><button className="btn btn-warning">Editar</button> </Link>
            <button onClick={handleDelete.bind(this, user._id)} className="btn btn-danger">Deletar</button>
        </div>
    </div>
);

export default List;
